def ok(n):
    b = bin(n)[2:]
    if "000" in b and "111" in b: return False
    for l in range(4, len(b)-1):
        h = set(b[i:i+l].count("1") for i in range(len(b)-l+1))
        if max(h) - min(h) > 2: return False
    return True
